module.exports = {
	extends: ['@commitlint/config-conventional'],
	rules: {
		'header-max-length': [2, 'always', 100]
	}
}

// @ts-check
module.exports = {
	preset: 'ts-jest',
	testMatch: ['**/*.test.ts', '**/*.test.tsx'],
	modulePathIgnorePatterns: ['<rootDir>\/packages\/core\/nccbuild\/(.*)'],
	roots: [
		'packages/analyzer',
		'packages/components',
		'packages/core',
		'packages/essentials',
		'packages/message',
		'packages/model',
		'packages/model-tree',
		'packages/site',
		'packages/tools',
		'packages/types',
		'packages/util'
	],
	testPathIgnorePatterns: ['node_modules', 'lib'],
	globals: {
		'ts-jest': {
			diagnostics: {
				ignoreCodes: [151001, 2339]
			}
		}
	}
};

{
	"npmClient": "yarn",
	"useWorkspaces": true,
  "version": "0.8.1"
}

{
	"extends": [
		"schedule:weekly",
		":maintainLockFilesWeekly"
	],
	"labels": ["renovate"],
	"minor": {
		"groupName": "all minor"
	}
}

{
	"files": [],
	"include": [],
	"references": [
		{
			"path": "./packages/core"
		},
		{
			"path": "./packages/site"
		},
		{
			"path": "./packages/tools"
		}
	],
	"compilerOptions": {
		"allowSyntheticDefaultImports": false,
		"composite": true,
		"downlevelIteration": true,
		"experimentalDecorators": true,
		"jsx": "react",
		"lib": ["dom", "es2017"],
		"module": "es2015",
		"moduleResolution": "node",
		"skipLibCheck": true,
		"sourceMap": true,
		"strict": true,
		"target": "es2017",
	}
}

/** @ts-check */
const Path = require('path');
const MonacoWebpackPlugin = require('monaco-editor-webpack-plugin');
const yargs = require('yargs-parser');
const flags = yargs(process.argv.slice(2));

const out = flags.out ? flags.out : './packages/core/lib';

module.exports = [
	{
		mode: flags.production ? 'production' : 'development',
		devtool: flags.production || flags.sourceMaps ? 'source-maps' : 'cheap-source-map',
		entry: {
			preview: require.resolve('./packages/core/src/preview/preview.ts'),
			previewRenderer: require.resolve('./packages/core/src/preview-renderer/index.ts'),
			renderer: require.resolve('./packages/core/src/renderer/index.tsx'),
			Mobx: require.resolve('mobx')
		},
		module: {
			rules: [
				{
					test: /\.tsx?$/,
					loader: 'ts-loader',
					options: {
						transpileOnly: true,
						compilerOptions: {
							module: 'esnext'
						}
					}
				},
				{
					test: /\.css$/,
					use: ['style-loader', 'css-loader']
				}
			]
		},
		resolve: {
			extensions: ['.ts', '.tsx', '.js']
		},
		plugins: [
			new MonacoWebpackPlugin({
				languages: ['typescript', 'json'],
				output: ''
			})
		],
		externals: {
			mobx: 'Mobx',
			osenv: false,
			child_process: false
		},
		output: {
			filename: '[name].js',
			library: '[name]',
			libraryTarget: 'window',
			path: Path.join(__dirname, out, 'scripts'),
			publicPath: '/scripts/'
		}
	}
];
